import React from "react";
import { useTranslation } from "react-i18next";
import CustomToolbar from "./Components/CustomToolbar";
import "./Styles/App.scss";

function App() {
  const { t, i18n } = useTranslation();
  return (
    <div className="App">
      <CustomToolbar
        title={t("title")}
        options={[
          t("nav.about"),
          t("nav.projects"),
          t("nav.services"),
          t("nav.careers"),
          t("nav.contact")
        ]}
      />
    </div>
  );
}

export default App;
